<#
.SYNOPSIS
    This file is a tool for automatically detecting and exploiting the following vulnerability: 
    IKE and AuthIP IPsec Keyring Modules Service (IKEEXT) Missing DLL

.DESCRIPTION 
    The vulnerability exists because of a missing DLL loaded by the 'IKE and AuthIP Keyring Modules' (IKEEXT) service which runs as SYSTEM.
    A successful exploitation results in a privilege escalation (from any authenticated user to SYSTEM).
    The following systems are affected:
        - Windows Vista / Windows 2008
        - Windows 7 / Windows Server 2008 R2
        - Windows 8 / Windows Server 2012 
    Requirements:
        - An insecure environment PATH to plant the DLL payload
        - Reboot privilege (if the service's start mode is AUTO)

.NOTES
    Filename: Ikeext-Privesc.ps1
    Author: Clement Labro (@itm4n)

.LINK
    https://github.com/itm4n/Ikeext-Privesc

.EXAMPLE
